var Node = function(){
    this.children = [];
    this.wordValue = false;
    this.sortedKeys = null;
}

Node.prototype = {
    addChild: function(letter){
        var n = new Node();
        this.children[letter] = n;
    },
    contains: function(letter){
        if(!letter) return false;
        return this.children[letter] !== undefined;
    },
    first: function(){
        if(this.wordValue) return this.wordValue; 
        var keys = this.getKeys();
        if(keys.length) return this.children[keys[0]].first();
        else return '';
    },
    find: function(suffix){
        if(!suffix) return this.first();
        var l = suffix[0];
        if(this.contains(l)) 
            return this.children[l].find(suffix.substring(1));
        return '';
    },
    getKeys: function(){
        if(!this.sortedKeys){
            this.sortedKeys = [];
            for(var p in this.children){
                this.sortedKeys.push(p);
            }
            this.sortedKeys.sort(caseInsensitiveSort);
        }
        return this.sortedKeys;
    }
}

var PrefixTree = function(){
    this.root = new Node();
}

PrefixTree.prototype = {
    addWord: function(word){
        var n = this.root;
        for( var i=0; i<word.length; i++ ){
            var l = word[i].toLowerCase();
            if( !n.contains(l) ){
                n.addChild(l);
            }
            n = n.children[l];
        }
        n.wordValue = word;
    },
    find: function(prefix){
        var n = this.root;
        var finds = n.find(prefix.toLowerCase());
        if(!finds)  return -1;
        return finds;
    }
}

var caseInsensitiveSort = function (a,b){
    if (a.toLowerCase() < b.toLowerCase()) return -1;
    if (a.toLowerCase() > b.toLowerCase()) return 1;
    return 0;
}

function typeahead(usernames, queries) {
    var prefixTree = new PrefixTree();
    var results = [];
    for( var i=0; i<usernames.length; i++){
        prefixTree.addWord(usernames[i]);
    }
    for(var i=0; i<queries.length; i++){
        results.push( prefixTree.find( queries[i] ) );
    }
    console.log(results.join("\n"));
}


